import { useNavigate } from "react-router-dom";

const Profile = () => {
    const onLogOutClick = () => {
        authService.signOut()

    };

    return (
        <>
            <button onClick={onLogOutClick}> Log Out </button>
        </>
    );
};
export default Profile;
